function callAjaxCats(n){var t={ID:n};$.ajax({type:"POST",url:"/Home/AddScoreToCat",contentType:"application/json",dataType:"json",data:JSON.stringify(t),success:function(n){n.length===3&&(console.log(n[0].url),console.log(n[1].url),$("#imgGauche").attr("src",n[0].url),$("#imgGauche").attr("val",n[0].id),$("#imgDroite").attr("src",n[1].url),$("#imgDroite").attr("val",n[1].id),$("#votes").text(n[2].score+" votes"))}})}$("#imgGauche").click(function(){catId=$("#imgGauche").attr("val");callAjaxCats(catId)});$("#imgDroite").click(function(){catId=$("#imgDroite").attr("val");callAjaxCats(catId)});